class Solution(object):
    def numWays(self, s):
        cnt = 0
        for v in s:
            if(v == '1'):
                cnt += 1
        if(cnt % 3 != 0):
            return 0
        if(cnt == 0):
            return ((len(s)-1)*(len(s)-2)//2) % (10**9 + 7)
        n = cnt//3
        cnt = 0
        idx1 = idx2 = idx3 = idx4 = -1
        for i, v in enumerate(s):
            if(v == '1'):
                cnt += 1
                if(idx1 == -1 and cnt == n):
                    idx1 = i
                if(idx2 == -1 and cnt == n+1):
                    idx2 = i
                if(idx3 == -1 and cnt == 2*n):
                    idx3 = i
                if(idx4 == -1 and cnt == 2*n+1):
                    idx4 = i
        return (idx2-idx1)*(idx4-idx3) % (10**9 + 7)


# print(10**9 + 7)
a = Solution()
